import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { Section1Component } from './content/section1/section1.component';
import { Section2Component } from './content/section2/section2.component';
import { HeaderComponent } from './content/header/header.component';
import { ProductsService } from './content/services/productServices';


@NgModule({
  declarations: [
    AppComponent,
    Section1Component,
    Section2Component,
    HeaderComponent,
  ],

  imports: [
    BrowserModule,
    AppRoutingModule
  ],

  providers: [ProductsService],
  bootstrap: [AppComponent]
})
export class AppModule { }
